import React from "react";
import Card from "../UI/Card";

import userClasses from "./Users.module.css"

const Users = props => {
if(props.item)
 return (
    <Card className = {userClasses.users}>
    <ul className={userClasses.users.ul}>{props.item.map(item => <li className={userClasses.users.li} key = {Math.random.toString()}> {item.name} ({item.age} years old)</li>)}</ul>
    </Card>
 );
};

export default Users;
